Gulmohar is a Marathi movie directed by Gajendra Ahire which revolves around Vidhya and Deven Dampatya. Vidhya is an all-rounder, she looks after the house and handles her career. She cares for her husband, loves him a lot and supports him in everything he does. Deven is just the opposite, he is a big failure in life. He tends to neglect his house while working, he is always under stress. Vidhya is the only person concerned about the house. At such times, a man named Bhagwan comes into her life. In the process of helping Bhagwan in shaping his life, some misconceptions about the relationship between them comes up. Deven alleges her of infidelity. Gulmohar is about how Vidhya comes out of this mess and puts her own life in order. 

